package org.eclipse.swt.examples.graphics;

import xeus.jcl.JarClassLoader;
import com.witwall.jcl.Base64;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.net.URL;
import java.net.URLClassLoader;


public class SwtResource {
	private static String res="";

	public  static void init(){
		System.setProperty("javax.xml.parsers.DocumentBuilderFactor", "gnu.xml.dom.DomDocumentBuilderFactory");
		System.setProperty("javax.xml.parsers.SAXParserFactory", "gnu.xml.stream.SAXParserFactory");
		String classpath=System.getProperty("java.class.path");
		System.setProperty("java.class.path", "E:\\JCGO\\java\\iText\\iText-4.2.0\\lib\\iText.jar;"+classpath);
		try {			
			byte[] buffer=Base64.decode(res);
			ByteArrayInputStream bis=new ByteArrayInputStream(buffer);
			JarClassLoader jcl = new JarClassLoader();
			jcl.add(bis);		
			Thread.currentThread().setContextClassLoader(jcl);
		} catch (IOException e) {
			System.out.println("Could not find resource file:graphics.zip");
		}
	}
}

